import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useCart } from '../../context/CartContext';

const HeaderComponent = ({ config, data }) => {
  const { cart } = useCart();
  const [searchQuery, setSearchQuery] = useState('');
  const [showDropdown, setShowDropdown] = useState(false);

  const itemCount = cart.items.reduce((total, item) => total + item.quantity, 0);

  const handleSearch = (e) => {
    e.preventDefault();
    // Implement search functionality
    console.log('Searching for:', searchQuery);
  };

  return (
    <>
      {/* Main Navigation Bar */}
      <nav className="navbar">
        <div className="container">
          <div className="d-flex align-items-center justify-content-between">
            {/* Logo */}
            <Link to="/" className="navbar-brand">
              <span className="fw-bold">styli</span>
              <span className="arabic">ستايلي</span>
            </Link>

            {/* Main Navigation Links */}
            <div className="navbar-nav-main d-none d-lg-flex">
              <Link to="/women" className="nav-link">WOMEN</Link>
              <Link to="/men" className="nav-link">MEN</Link>
              <Link to="/kids" className="nav-link">KIDS</Link>
              <Link to="/beauty" className="nav-link">BEAUTY</Link>
              <Link to="/" className="nav-link">HOME</Link>
            </div>

            {/* Search Bar */}
            <div className="search-container d-none d-md-block">
              <form onSubmit={handleSearch}>
                <div className="input-group">
                  <span className="input-group-text">
                    <i className="fas fa-search"></i>
                  </span>
                  <input
                    type="text"
                    className="form-control"
                    placeholder="What are you looking for?"
                    value={searchQuery}
                    onChange={(e) => setSearchQuery(e.target.value)}
                  />
                </div>
              </form>
            </div>

            {/* User Actions */}
            <div className="user-actions">
              <Link to="/profile" className="btn">
                <i className="fas fa-user"></i>
              </Link>
              <Link to="/wishlist" className="btn">
                <i className="fas fa-heart"></i>
              </Link>
              <Link to="/cart" className="btn cart-badge">
                <i className="fas fa-shopping-bag"></i>
                {itemCount > 0 && (
                  <span className="badge">{itemCount}</span>
                )}
              </Link>
            </div>
          </div>
        </div>
      </nav>

      {/* Dropdown/Mega Menu */}
      <nav className="navbar-dropdown">
        <div className="container">
          <div className="dropdown-nav">
            <Link to="/clothing" className="nav-link">CLOTHING</Link>
            <Link to="/summer-holiday" className="nav-link">SUMMER HOLIDAY EDIT</Link>
            <Link to="/sale" className="nav-link sale">SALE</Link>
            <Link to="/new-arrivals" className="nav-link">NEW ARRIVALS</Link>
            <Link to="/brands" className="nav-link">BRANDS</Link>
            <Link to="/footwear" className="nav-link">FOOTWEAR</Link>
            <Link to="/topwear" className="nav-link">TOPWEAR</Link>
            <Link to="/bottomwear" className="nav-link">BOTTOMWEAR</Link>
            <Link to="/denimwear" className="nav-link">DENIMWEAR</Link>
            <Link to="/grooming" className="nav-link">GROOMING</Link>
            <Link to="/accessories" className="nav-link">ACCESSORIES</Link>
            <Link to="/sportswear" className="nav-link">SPORTSWEAR</Link>
            <Link to="/underwear" className="nav-link">UNDERWEAR & NIGHTWEAR</Link>
          </div>
        </div>
      </nav>

      {/* Mobile Search (visible on mobile) */}
      <div className="d-md-none bg-light py-2">
        <div className="container">
          <form onSubmit={handleSearch}>
            <div className="input-group">
              <span className="input-group-text">
                <i className="fas fa-search"></i>
              </span>
              <input
                type="text"
                className="form-control"
                placeholder="What are you looking for?"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
            </div>
          </form>
        </div>
      </div>
    </>
  );
};

export default HeaderComponent;
